  [],\n\t\"revision_timestamp\": \"2016-07-27T23:00:12.432158\",\n\t\"name\": \"hunt-plan-for-montezuma-national-wildlife-refuge-1995\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of the white-tailed deer
  hunting program are: 1. To maintain the deer population at a level compatible with
  the quality and diversity of habitats not only for deer, but also for those species
  which share portions of those habitats and interact with deer; 2. To protect forested
  and scrub/shrub habitats by controlling the size of the Refuge's pre-wintering deer
  population; and 3. To provide the general public with a safe, quality wildlife-oriented
  recreational experience, and an opportunity to harvest a renewable natural resource.
  This detailed plan provides an historical and biological context for hunting on
  the refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
